def prime_list(lst):

    def is_prime(n):
        if n <= 2:
            return False
        for i in range(2, int(n ** 0.5) + 1):
            if n % i == 0:
                return False
        return True
    result = []
    for x in lst:
        if is_prime(x) and (not result or x != result[-1]):
            result.append(x)
    result.sort(reverse=True)
    return result

